import React from 'react';
// import homeProfileImg from '../home-imgs/home-profile-img.JPG';

import { Link } from 'react-router-dom';
// import { BrowserRouter as Router, Switch, Route, Routes } from 'react-router-dom';
import './Home.css';
// import { ImageGroup } from 'semantic-ui-react';


function Home() {
  return (
      <div className="App">
      <div className='container'>
        <body className='app-body'>
          <div className='body-left'>
            <div className='home-img-align'>
              <div className='home-img'>
                <img src={homeProfileImg} alt='Photo of Loveleen Bassi' style={{height: '100%', width: 'auto', filter: 'grayscale(100%)'}} />
              </div>
            </div>
          </div>
          <div className='body-right'>
            <div className='right-body-align'>
              <div className='home-text'>
                <p ><span className='home-1'>Hello</span></p>
                <p className='home-text-align'><span className='home-2'>A Bit About Me</span></p>
                <p className='home-text-aligns'><span className='home-3'>I'm a paragraph. Click here to add your own text and edit me. I'm a great palce for you to tell a story and let your users know a little more about you.</span></p>
              </div>
              <div className='home-buttons-align'>
                <Link to="/ResumePage">
                    <button className='home-buttons' id='yellow-btn'>Resume</button>
                </Link>
                {/* <ResumePage /> */}
                <Link to='/ProjectPage'>
                    <button className='home-buttons' id='red-btn'>Projects</button>
                </Link>
                <Link to='/ContactPage'>
                    <button className='home-buttons' id='blue-btn'>Contact</button>
                </Link>
              </div>
            </div>
          </div>
        </body>
      </div>


    </div>
  );
}

export default Home;
